import * as BuildingNumbersActivity from './hundredsgrid/building_numbers_data.js'
import * as JellyBeanActivity from './hundredsgrid/jellybean/jelly_bean_data.js'

export default ACTIVITIES = {
    fraction_line_jelly_bean: JellyBeanActivity.ACTIVITY,
    hundred_grid_place_value: BuildingNumbersActivity.ACTIVITY,
}
